import React from 'react';

const About = () => {
    return (
        <div id='/about'>
            <h2 className='left'>
                <strong>IT Logger</strong>
            </h2>
            <h3>Version 1.0.0</h3>
            <div className='modal-footer'>Created By : Abdulaziz Suria</div>
        </div>
    );
};

export default About;
